"      Patient information: Pregnancy symptoms (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?36/56/37762?source=see_link\">",
"      Patient information: Taking over-the-counter medicines during pregnancy (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?29/42/30370?source=see_link\">",
"      Patient information: Motion sickness (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?4/7/4210?source=see_link\">",
"      Patient information: Hyperemesis gravidarum (The Basics)",
"     </a>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H5518879\">",
"     <span class=\"h3\">",
"      Beyond the Basics",
"     </span>",
"     &nbsp;&mdash;&nbsp;Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are best for patients who want in-depth information and are comfortable with some medical jargon.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?2/50/2851?source=see_link\">",
"      Patient information: Should I have a screening test for Down syndrome during pregnancy? (Beyond the Basics)",
"     </a>",
"     <br/>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H16\">",
"     <span class=\"h2\">",
"      Professional level information",
"     </span>",
"     &nbsp;&mdash;&nbsp;Professional level articles are designed to keep doctors and other health professionals up-to-date on the latest medical findings. These articles are thorough, long, and complex, and they contain multiple references to the research on which they are based. Professional level articles are best for people who are comfortable with a lot of medical terminology and who want to read the same materials their doctors are reading.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?15/47/16120?source=see_link\">",
