var title_f36_63_37879="Histopathology of tendinosis";
var content_f36_63_37879=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F73812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F73812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 564px\">",
"   <div class=\"ttl\">",
"    Histopathology of tendinosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 544px; height: 463px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Normal tendon. H&amp;E.",
"    <br>",
"     (B) Increased tenocytes. H&amp;E, patellar tendinopathy. Note the large increase in tenocyte numbers characteristic of tendinosis. The dense central structure represents a vessel wall.",
"     <br>",
"      (C) Increased proteoglycan. H&amp;E, patellar tendinopathy. Increased blue-staining material surrounding an area of hypocellularity typical of tendinosis.",
"      <br>",
"       (D) Vascular hyperplasia. H&amp;E, patellar tendinopathy. Large increase in the presence of microvessels within the tendon substance.",
"       <br>",
"        (E) Collagen disorganization. H&amp;E, patellar tendinopathy. Focal collagen degeneration.",
"        <div class=\"footnotes\">",
"        </div>",
"        <div class=\"reference\">",
"         Scott A, Khan KM, Cook J, Duronio V. Human tendon overuse pathology: Histopathologic and biochemical findings. In: Tendinopathy in Athletes, Woo SL, Arnoczky SP, Renstrom P (Eds). Malden: Wiley-Blackwell, 2007. Copyright &copy; 2007. Reproduced with permission of Wiley-Blackwell.",
"        </div>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
