"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        None",
"        <br/>",
"        (&lt;5 percent)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Some dehydration",
"        <br/>",
"        (5-10 percent)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Severe dehydration",
"        <br/>",
"        (&gt;10 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        General appearance",
"       </td>",
"       <td>",
"        Well, alert",
"       </td>",
"       <td>",
"        Restless, irritable",
"       </td>",
"       <td>",
"        Lethargic or unconscious",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Eyes",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Sunken",
"       </td>",
"       <td>",
"        Sunken",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thirst",
"       </td>",
"       <td>",
"        Drinks normally, not thirsty",
"       </td>",
"       <td>",
"        Thirsty, drinks eagerly",
"       </td>",
"       <td>",
"        Drinks poorly or unable to drink",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skin pinch",
"       </td>",
"       <td>",
"        Goes back quickly",
"       </td>",
"       <td>",
"        Goes back slowly",
"       </td>",
"       <td>",
"        Goes back very slowly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Estimated fluid deficit",
"       </td>",
"       <td>",
"        &lt;50 mL/kg",
"       </td>",
"       <td>",
"        50-100 mL/kg",
"       </td>",
"       <td>",
"        &gt;100 mL/kg",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
